import React from 'react';

function Footer() {
  return (
    <div className='footer-container'>
        <section className='footer-subscription'>
            <p className='footer-subscription-heading'>
                Available with the Contacts below!
            </p>
        </section>
    </div>
  );

}

export default Footer;
